(1, 'About Us', '<p>About Us</p>'),
(2, 'Privacy Policy', '<h2>Privacy Policy&nbsp;</h2>\r\n<p>[Developer/Company name] built the [Game Title] game as [open source/free/freemium/ad-supported/commercial] game. This SERVICE is provided by [Developer/Company name] [at no cost] and is intended for use as is.</p>\r\n<p>This page is used to inform visitors regarding [my/our] policies with the collection, use, and disclosure of Personal Information if anyone decided to use [my/our] Service.</p>\r\n<p>If you choose to use [my/our] Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that [I/We] collect is used for providing and improving the Service. [I/We] will not use or share your information with anyone except as described in this Privacy Policy.</p>\r\n<p>The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which is accessible at [Game Title] unless otherwise defined in this Privacy Policy.</p>\r\n<p><strong>Information Collection and Use</strong></p>\r\n<p>For a better experience, while using our Service, [I/We] may require you to provide us with certain personally identifiable information[add whatever else you collect here, e.g. users name, address, location, pictures] The information that [I/We] request will be [retained on your device and is not collected by [me/us] in any way]/[retained by us and used as described in this privacy policy].</p>\r\n<p>The game does use third party services that may collect information used to identify you.</p>\r\n<div>\r\n<p>Link to privacy policy of third party service providers used by the game</p>\r\n<ul>\r\n<li><a href=\"https://www.google.com/policies/privacy/\" target=\"_blank\" rel=\"noopener\">Google Play Services</a></li>\r\n</ul>\r\n</div>\r\n<p><strong>Log Data</strong></p>\r\n<p>[I/We] want to inform you that whenever you use [my/our] Service, in a case of an error in the game [I/We] collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (&ldquo;IP&rdquo;) address, device name, operating system version, the configuration of the game when utilizing [my/our] Service, the time and date of your use of the Service, and other statistics.</p>\r\n<p><strong>Cookies</strong></p>\r\n<p>Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device\'s internal memory.</p>\r\n<p>This Service does not use these &ldquo;cookies&rdquo; explicitly. However, the game may use third party code and libraries that use &ldquo;cookies&rdquo; to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.</p>\r\n<p><strong>Service Providers</strong></p>\r\n<p>[I/We] may employ third-party companies and individuals due to the following reasons:</p>\r\n<ul>\r\n<li>To facilitate our Service;</li>\r\n<li>To provide the Service on our behalf;</li>\r\n<li>To perform Service-related services; or</li>\r\n<li>To assist us in analyzing how our Service is used.</li>\r\n</ul>\r\n<p>[I/We] want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.</p>\r\n<p><strong>Security</strong></p>\r\n<p>[I/We] value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and [I/We] cannot guarantee its absolute security.</p>\r\n<p><strong>Links to Other Sites</strong></p>\r\n<p>This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by [me/us]. Therefore, [I/We] strongly advise you to review the Privacy Policy of these websites. [I/We] have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.</p>\r\n<p><strong>Children&rsquo;s Privacy</strong></p>\r\n<p>These Services do not address anyone under the age of 13. [I/We] do not knowingly collect personally identifiable information from children under 13. In the case [I/We] discover that a child under 13 has provided [me/us] with personal information, [I/We] immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact [me/us] so that [I/We] will be able to do necessary actions.</p>\r\n<p><strong>Changes to This Privacy Policy</strong></p>\r\n<p>[I/We] may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. [I/We] will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted on this page.</p>\r\n<p><strong>Contact Us</strong></p>\r\n<p>If you have any questions or suggestions about [my/our] Privacy Policy, do not hesitate to contact [me/us] at [Game Contact informations].</p>'),
(3, 'Terms And Conditions', '<h2><strong>Terms and Conditions</strong></h2>\r\n<p>Welcome to&nbsp;<span class=\"highlight preview_website_name\">Website Name</span>!</p>\r\n<p>These terms and conditions outline the rules and regulations for the use of&nbsp;<span class=\"highlight preview_company_name\">Company Name</span>\'s Website, located at&nbsp;<span class=\"highlight preview_website_url\">Website.com</span>.</p>\r\n<p>By accessing this website we assume you accept these terms and conditions. Do not continue to use&nbsp;<span class=\"highlight preview_website_name\">Website Name</span>&nbsp;if you do not agree to take all of the terms and conditions stated on this page.</p>\r\n<p>The following terminology applies to these Terms and Conditions, Privacy Statement and Disclaimer Notice and all Agreements: &ldquo;Client&rdquo;, &ldquo;You&rdquo; and &ldquo;Your&rdquo; refers to you, the person log on this website and compliant to the Company\'s terms and conditions. &ldquo;The Company&rdquo;, &ldquo;Ourselves&rdquo;, &ldquo;We&rdquo;, &ldquo;Our&rdquo; and &ldquo;Us&rdquo;, refers to our Company. &ldquo;Party&rdquo;, &ldquo;Parties&rdquo;, or &ldquo;Us&rdquo;, refers to both the Client and ourselves. All terms refer to the offer, acceptance and consideration of payment necessary to undertake the process of our assistance to the Client in the most appropriate manner for the express purpose of meeting the Client\'s needs in respect of provision of the Company\'s stated services, in accordance with and subject to, prevailing law of Netherlands. Any use of the above terminology or other words in the singular, plural, capitalization and/or he/she or they, are taken as interchangeable and therefore as referring to same.</p>\r\n<h3><strong>Cookies</strong></h3>\r\n<p>We employ the use of cookies. By accessing&nbsp;<span class=\"highlight preview_website_name\">Website Name</span>, you agreed to use cookies in agreement with the&nbsp;<span class=\"highlight preview_company